export class SequenceDiff{constructor(t,e){this.seq1Range=t,this.seq2Range=e}reverse(){return new SequenceDiff(this.seq2Range,this.seq1Range)}toString(){return`${this.seq1Range} <-> ${this.seq2Range}`}}export class OffsetRange{constructor(t,e){this.start=t,this.endExclusive=e}get isEmpty(){return this.start===this.endExclusive}delta(t){return new OffsetRange(this.start+t,this.endExclusive+t)}get length(){return this.endExclusive-this.start}toString(){return`[${this.start}, ${this.endExclusive})`}join(t){return new OffsetRange(Math.min(this.start,t.start),Math.max(this.endExclusive,t.endExclusive))}}